import styled from "styled-components";

export const Input = styled.input`
  width: 100%;
  padding: 0.5em 0em;
  border-bottom: 1px solid ${({ theme }) => theme.colors.grey1};
`;

export const WrapInputPassword = styled.div``;

export const InputPassword = styled(Input)``;
